import italy from "./components/assets/italy.JPG"
import newYork from "./components/assets/newYork.JPG"
import trees from "./components/assets/trees.JPG"


export default [
    {
        title: "Exploring Europe!",
        location: "Italy",
        googleMapsUrl: "https://goo.gl/maps/6VyzuJMLensLsd4D9",
        startDate: "August, 2019",
