    },
    {
        title: "Never seen anything like New York!",
        location: "The big apple",
        googleMapsUrl: "https://goo.gl/maps/8aLL5rXGS64HVMeV7",
        startDate: "December, 2019",
        endDate: "January, 2020",
        description: "New York is definatley a unqiue sight. The hustle and bustle of the city is incredibly attractive as long as you're not the one going to work. From the great parks to time squares lights New York has it all. Visiting New York during christmas is definatley a sight to see (Trips Highlight: Home Alone's Christmas Tree) ",
